#前撮り 

서울에 살 때는 에어컨이 없는 집에서 살았어서 낮에는 자고 저녁에 일어나서 서늘한 밤공기를 즐기곤 했었다.
한강이나 청개천 근처의 서늘한 여름 밤바람과 뭔가 들뜬 기분의 거리들. 맥주를  즐기던 길가 상점과 편의점 사람들.
늘 대학가에서 살아서 그랬는지도 모르겠다.

그래서 여름을 떠올리면 늘- 시원한 밤공기와 뭔가 들뜬 홍대나 신촌의 밤거리, 시원한 아메리카노 따위가 생각난다.

생각해보면 지난 20대 30대엔 늘 짝사랑 중이었던 것 같다.
서울살이를 하면서도 동경하는 마음이 컸었고, 내가 접해보지 못한 세상은 비눗방울처럼 무지갯빛 찬란해보이는 별세계 같았고.
늘 어디에도 섞이지 못하는 기분을 숨기기 위해 등을 더 바짝 펴고 고개를 들고 입꼬리를 올리고.
손에 쉽게 잡히지 않는 모든 것이 다 아름다워보이거나, 혹은 쥐지 못해서 억울하거나 했었지.

여름밤을 하루 하루 보내면서도
늘 그런 기분들을 그리워하며 떠올렸던 것처럼
가장 행복할 때 그걸 알아차리지 못하고 지나쳐버리는 건
좀 아까운 일은 아니었을까.

창 밖으로 들리는 풀벌레소리가 
지나가는 여름을 잡아끌지만
계절은 이렇게 또 한꺼풀.

2020년의 여름은 살아온 그 어느 해의 여름과도 달랐지만, 좀 많이 억울하고 우울하고 지치긴 했지만-
언젠가 시간이 많이 지나 돌아봤을 때
그래 맞아 그때 그랬지
웃으면서 떠올릴 수 있을까.

그 때 난 참 그래도 행복했었네 
그렇게 말할 수 있을 것 같아서
새삼 감사한 마음으로 떠나보내는 #나의여름
#여름아잘가
내년에는 우리 조금 더 건강한 모습으로 다시 만나자
#여행도가고싶고
좋은 소식도 많이 듣는 
